import React from 'react';
import { Outlet, Link } from 'react-router-dom';
import PropTypes from 'prop-types';

const Nav = (props) => {
    return (
        <>
            <nav className='list-none mt-2 mb-4 md:flex md:w-full'>
                <ul className='text-red-400 font-medium md: w-full md:flex md:justify-between '>
                    <li className='pb-2'>
                        <Link to='/'>Présentation</Link>
                    </li>
                    <li className='pb-2'>
                        <Link to='/curriculum'>Mes projets</Link>
                    </li>
                    <li className='pb-2'>
                        <Link to='/contact'>Contact</Link>
                    </li>
                </ul>
            </nav>
            <Outlet />
        </>
    );
};

Nav.propTypes = {};

export default Nav;
